import React from 'react'
import dataService from '../../untils/dataService'
const Service = () => {
  return (
    <div className=' w-screen grid grid-cols-4 gap-4'>
        {dataService.map(el => {
            return <div key={el.id} className='w-[100%] h-[80px] flex-col justify-center items-center bg-colorCyan rounded-lg'>
                <span>{el.title}</span>
                <span>{el.desc}</span>
            </div>
        })}
    </div>
  )
}

export default Service
